import styled from 'styled-components'

const TimeProcess = ({props}) => {
    return <Wrapper>
        <Cover>
            <TimeLine>{props.time}</TimeLine>
            <Content>
            {props.data}
            </Content>
            <Circle />
        </Cover>
    </Wrapper>
}

const Content = styled.div`
padding-top: 10px;
`

const TimeLine = styled.div`
    position: absolute;
    top: -5px;
    left: 15px;
    font-size: 12px;
`

const Circle = styled.div`
    height: 10px;
    width: 10px;
    border-radius: 50%;
    position: absolute;
    background-color: gb(251,189,136) 
`

const Cover = styled.div`
    margin-top: 20px;
    position: relative;
    border-left: 1px solid rgb(251,189,136);
    padding-bottom: 10px;
    padding-left: 15px;

`

const Wrapper = styled.div`
    margin: 5px;
`

export default TimeProcess
